import { StyleSheet} from 'react-native';
import {NativeRouter, Route, Routes} from 'react-router-native';
import PlantNavbar from './Components/PlantNavbar';
import TitleBar from './Components/TitleBar';
import HMP from './Components/HMP';
import MyPlants from './Components/MyPlants';
import { NativeBaseProvider, Container, Center } from 'native-base';
import Recognize from './Components/Recognize';

function App(){
  return (
    <NativeBaseProvider>
      <NativeRouter>
        <Routes>
            <Route exact path="/" element={<Center><TitleBar name='Homepage'/><HMP/><PlantNavbar/></Center>} />
            <Route path="/recognize" element={<Container><TitleBar name='Recognize' previous='/'/><Recognize/><PlantNavbar/></Container>}/>
            <Route path="/myplants" element={<Container><TitleBar name='My Plants' previous='/'/><MyPlants/><PlantNavbar/></Container>}/>
        </Routes>
      
      </NativeRouter>
    </NativeBaseProvider>
  );
}


export default App;
